    /**
     * 获取车次str
     * @param map
     * @param trains
     * @param seats 二等 硬座等
     * @return
     */
    public static  List< Map<String,String>> getSecretStr( Map<String,Map<String,String>> map,String trains,String seats){
        String[] che=trains.split(",");
        String[] xb=seats.split(",");
        List< Map<String,String>> youpiaoList=new ArrayList<Map<String,String>>();
        long time =System.currentTimeMillis()/1000;
        SimpleDateFormat simpleDateFormat = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss");
        String dateTime=simpleDateFormat.format(new Date(time*1000));
        for(String c:che){
            Map<String,String> xibiemap = map.get(c);
            if(null!=xibiemap){
                for(String xbie:xb){
                    String cnt=xibiemap.get(xbie);
                    if(null!=cnt && !"无".equals(cnt) && !"".equals(cnt)){
                        System.out.println();
                        if(!"有".equals(cnt) && Integer.parseInt(cnt)< CommonUtilBak.user.split(",").length){
                            System.out.println(c+" "+xbie+" 有票："+cnt+"但是不够"+ CommonUtilBak.user+" "+ CommonUtilBak.user.split(",").length+"个,忽略" );
                        }else{
                            System.out.println(c+" "+xbie+" 有票："+cnt );
                            xibiemap.put("toBuySeat",xbie);
                            youpiaoList.add(xibiemap);
                        }
                    }else{
                        if(time%5==0){
                            System.out.println(dateTime+"无票");
                        }
                    }
                }

            }
        }
        return youpiaoList;
    }

